import CategoryNewsItem from '../item/CategoryNewsItem'

const CategoryNews = () => {
  var list = []
  for (var i = 0; i < 7; i++) {
    list.push(
      <div className="column is-half" style={{ 'grid-template': 'repeat(2, 1fr)' }}>
        <CategoryNewsItem className="w-100"/>
      </div>
    )
  }
  return (
    <section className="category-news columns w-100 m-v-10">
      {list}
    </section>
  )
}

export default CategoryNews
